import React from 'react'
import background from '../Assets/bgbg.png'
import '../Stylesheets/Home.css'

function Home() {
  return (
    <div>
      <Search />
    </div>
  )
}

export default Home

function Search() {
  return(
    <div className='home w-full'>
      <div className=' pl-[7%] pt-[2%] flex'>
        <h1 className='text-white absolute font-bold text-[50px] leading-[110px] pt-[5%] text-center'>LETS FIND THE PERFECT HOUSE FOR YOU</h1>
        <img className='ml-[36.5vw] max-w-[60%] justify-end float-right' src={ background } alt=' a building' />
      </div>
    </div>
  )
}
